INSERT INTO `classification` VALUES ('1','','Basic domains','TRANSFAC class description C0033: Proteins belonging to this superfamily contact the DNA through a basic region which free in solution has a random structure, but becomes alpha-helically folded upon binding to DNA (PMID 2120592, PMID 2145515, PMID 1312255, PMID 8479534, PMID 7926781). Most prominent classes of this group are the bZIP and bHLH proteins. There is no \'consensus\' motif for all basic domains of this superfamily. Even the basic regions of bZIP and bHLH factors diverge greatly, although their mode of interacting with the DNA is strictly homologous: A specific alpha-helical dimerization domain provides the linkage between two DNA-contacting basic regions which adopt helical conformation when their positively charged side chains are neutralized by the phosphate backbone of the DNA.',1),('1.1','1','Basic leucine zipper factors (bZIP)','TRANSFAC class description C0008: A DNA-binding basic region is followed by a leucine zipper. The leucine zipper consists of repeated leucine residues at every seventh position and mediates protein dimerization as a prerequisite for DNA-binding. The leucines are directed towards one side of an alpha-helix. The leucine side chains of two polypeptides are thought to interdigitate upon dimerization (knobs-into-holes model). The leucine zipper dictates dimerization specificity. Upon DNA-binding of the dimer, the basic regions adopt alpha-helical conformation as well. Possibly, a sharp angulation point separates two alpha-helices of the subregions A and B leading to the scissors grip model for the bZIP-DNA complex. The DNA is contacted through the major groove over a whole turn.',2),('1.1.1','1.1','Jun-related factors','Family',3),('1.1.1.1','1.1.1','Jun factors','Subfamily',4),('1.1.1.1.1','1.1.1.1','c-Jun','Genus',5),('1.1.1.1.2','1.1.1.1','JunB','Genus',5),('1.1.1.1.3','1.1.1.1','JunD','Genus',5),('1.1.1.2','1.1.1','NF-E2-like factors','Subfamily',4),('1.1.1.2.1','1.1