2.3.4.0.70','2.3.4.0','ZNF132 [2+16]','Genus',5),('2.3.4.0.71','2.3.4.0','PRDM9 [1+13] (PFM6)','Genus',5),('2.3.4.0.72','2.3.4.0','ZBTB17 [12+1] (MIZ1, ZNF151, ZNF60)','Genus',5),('2.3.4.0.73','2.3.4.0','ZNF407 [3+3+1+2+2+11]','Genus',5),('2.3.4.0.74','2.3.4.0','E4F1 [3+6] (p120E4F, p50E4F)','Genus',5),('2.3.4.0.75','2.3.4.0','ZNF462 [1+2+2+1+3+1+1+3+2+1+4+5+1]','Genus',5),('2.3.4.0.76','2.3.4.0','ZNF644 [5+1+1] (ZEP2)','Genus',5),('2.3.4.0.77','2.3.4.0','ADNP [4+3+2] (ADNP1) = 3.1.8.1.1','Genus',5),('2.3.4.0.78','2.3.4.0','ADNP2 [1+1+1+1] (ZNF508) = 3.1.8.1.2','Genus',5),('2.3.5','2.3','BED zinc finger factors','Family',3),('2.3.5.0.1','2.3.5','ZBED1 (ALTE, DREF, TRAMP)','Genus',5),('2.3.5.0.2','2.3.5','ZBED2','Genus',5),('2.3.5.0.3','2.3.5','ZBED3','Genus',5),('2.3.5.0.4','2.3.5','ZBED4','Genus',5),('2.3.5.0.5','2.3.5','ZBED5','Genus',5),('2.3.5.0.6','2.3.5','ZBED6','Genus',5),('2.4','2','C6 zinc cluster factors','TRANSFAC class description C0005: Zinc finger motif of GAL4-type. Present to date in many fungal regulators. The proteins are typically, though not exclusively transcriptional activators. Six cysteine residues coordinate two zinc ions, i. e. two of the thiol groups coordinate two zinc ions (six cysteines binuclear cluster DNA-binding domain). All GAL4-type proteins possess a single N-terminal zinc finger  with an adjacent basic region, which is critical for sequence-specific recognition. Each C3-repeat unit of the structural motif of six cysteines forms short alpha-helical structures separated by a loop with a proline-associated turn. A number of zinc cluster proteins contain leucine zipper-like heptad repeat motifs C-terminal to the zinc-cluster. These motifs have been shown to form coiled-coil structures involved in protein-protein interactions (often homodimerization). The GAL-4 protein binds as a dimer to DNA sites characterized by the presence of two CGG triplets separated by 11 base pairs. The zinc(II)-binding cluster lies in the DNA major groove and contacts three base pairs.',2),('2.5','2','DM-type intertwined zinc finger factors','Class description: The known transcription factors exhibiting a DNA-binding domain of intertwined zinc fingers belong to the DM group of proteins, named after Drosophila Doublesex and C. elegans Meb-3. Intertwined are one zinc finger of C2HC and one of HCC2 type, each binding one zinc ion. Together, they follow the consensus pattern C--C--h--------H---C----c-c-c, where upper and lower case letter refer to either zinc finger, and dashes symbolize any other amino acid. The most C-terminal cysteine is part of a short alpha-helical structure, which extends into a carboxy-terminal tail that stably folds into an alpha helix upon binding to DNA. This recognition helix binds in the minor groove of the DNA. In contrast to other minor-groove binders, it does not induce a sharp bending of the DNA. (PMID 16382145)',2),('2.5.1','2.5','DMRT','Family',3),('2.5.1.0.1','2.5.1','DMRT1','Genus',5),('2.5.1.0.2','2.5.1','DMRT2','Genus',5),('2.5.1.0.3','2.5.1','DMRT3','Genus',5),('2.5.1.0.4','2.5.1','DMRTA1 (DMRT4)','Genus',5),('2.5.1.0.5','2.5.1','DMRTA2 (DMRT5)','Genus',5),('2.5.1.0.6','2.5.1','DMRTB1','Genus',5),('2.5.1.0.7','2.5.1','DMRTC2','Genus',5),('2.5.1.0.8','2.5.1','DMRTC1 (no DM domain!)','Genus',5),('2.6','2','CXXC zinc finger factors','Class description: CXXC zinc fingers contain two zinc ion binding 4-cysteine patterns, each of them comprising a CGxCxxC motif and a distantly located cysteine. One of these patterns (with lower-case Cs) is embedded within the other (with upper-case Cs): C-x(2)-C-x(2)-C-x(5,6)-c-x(2)-c-x(2)-c-x(9,15)-c-x(4)-C. The second and third cysteine of each motif lie within a short alpha-helix. The overall finger structure also forms a two-stranded antiparallel beta-sheet, the two beta-strands being located immediately N- and C-terminally adjacent to the CXXC zinc finger pattern. The CXXC zinc finger binds to DNA at CpG-containing sequences, most of the contacts are exerted by residues of an extended loop in the x(9,15) region of the above signature. (PMID 16990798)',2),('2.6.1','2.6','CpG-binding proteins','Family',3),('2.6.1.0.1','2.6.1','CpG-binding protein (CXXC1, CFP1, CGBP, PCCX1, PHF18)','Genus',5),('2.6.1.0.2','2.6.1','MBD1 (CXXC3, PCM1)','Genus',5),('2.6.1.0.3','2.6.1','TET1 (CXXC6, LCX)','Genus',5),('2.6.1.0.4','2.6.1','MLL (CXXC7, ALL1, HRX, HTRX, KMT2A, MLL1, TRX1)','Genus',5),('2.6.1.0.5','2.6.1','KDM2A (CXXC8, FBL7, FBXL11, JHDM1A)','Genus',5),('2.6.1.0.6','2.6.1','DNMT1 (CXXC9, AIM, DNMT)','Genus',5),('2.6.1.0.7','2.6.1','MLL2 (HRX2, KMT2D, WBP7, MLL4, TRX2)','Genus',5),('2.7','2','C2HC zinc finger factors','Class description: The individual zinc finger modules of this class are characterized by a tetrahedrical coordination of one zinc ion by three cysteines and one histidine, arranged according to the pattern C-X(2,4)-C-X(12)-H-(3,5)-C, similar to C2H2 zinc fingers. In contrast to them, they form a rather irregular, but compact structure without recognizable secondary structure elements. At least some C2HC zinc fingers bind sequence-specifically to DNA, where the whole C2HC zinc finger sites in the major groove. (PMID 14744132, PMID 18073212) &#8211; This class should not be mixed up with CCHC zinc fingers, which follow the signature C--C----H----C (i.e., having much shorter spacing between the leading two C and the H), and are mostly RNA-binders.',2),('2.7.1','2.7','Myelin transcription factor-related proteins','Family',3),('2.7.1.0.1','2.7.1','MYT1 (MyT1, MTF1, MYTI, PLPB1) [7]','Genus',5),('2.7.1.0.2','2.7.1','MYT1L (MyT1L, NZF-1) [6]','Genus',5),('2.7.1.0.3','2.7.1','ST18 (ZNF387, NZF-3) [6]','Genus',5),('2.7.2','2.7','Friend of GATA proteins','Family',3),('2.7.2.0.1','2.7.2','FOG1 (ZFPM1, ZFN89A) [5] = 2.3.4.0.6','Genus',5),('2.7.2.0.2','2.7.2','FOG2 (ZFPM2, ZFN89B) [5] = 2.3.2.4.6','Genus',5),('2.7.3','2.7','Histone acetyltransferases with C2HC zinc finger','Family',3),('2.7.3.0.1','2.7.3','MYST1 (TIP60 protein 1) [1]','Genus',5),('2.7.3.0.2','2.7.3','MYST2 (TIP60 protein 2, HBO1, HBOa) [1]','Genus',5),('2.7.3.0.3','2.7.3','MYST3 (TIP60 protein 3, RUNXBP2, ZNF220) [1]','Genus',5),('2.7.3.0.4','2.7.3','MYST4 (TIP60 protein 4, MORF, MOZ2) [1]','Genus',5),('2.7.3.0.5','2.7.3','KAT5 (HTATIP, TIP60) [1]','Genus',5),('2.7.4','2.7','Lethal(3)malignant brain tumor-related proteins','Family',3),('2.7.4.0.1','2.7.4','L3MBTL1 (L3MBT, L3MBTL) [1]','Genus',5),('2.7.5','2.7','LYAR-related proteins','Family',3),('2.7.5.0.1','2.7.5','LYAR (PNAS-5) [2]','Genus',5),('2.8','2','C3H zinc finger factors','Class description: These factors comprise a putative zinc finger motif with the signature C------C-----C---H. DNA-binding has been proven only for three proteins of this class, ZC3H8 (2.8.1.0.1), of which closely related proteins have been included for similarity, ZGPAT (2.8.2.0.1), with no close relatives found, and RC3H2 (2.8.4.0.1). Most, if not all, other proteins of this class appear to be RNA-binders and be involved more likely in splicing rather than transcriptional regulation.',2),('2.8.1','2.8','ZC3H8-related factors','Family',3),('2.8.1.0.1','2.8.1','ZC3H8 (ZC3HDC8, FLIZ1) [3]','Genus',5),('2.8.1.0.2','2.8.1','ZC3H4 [3]','Genus',5),('2.8.1.0.3','2.8.1','ZC3H6 (ZC3HDC6) [3]','Genus',5),('2.8.2','2.8','ZGPAT-related factors','Family',3),('2.8.2.0.1','2.8.2','ZGPAT (GPATC6, GPATCH6, ZC3H9, ZC3HDC9, ZIP) [1]','Genus',5),('2.8.3','2.8','RC3H-related factors','Family',3),('2.8.3.0.1','2.8.3','RC3H2 (MNAB, RNF164) [1]','Genus',5),('2.8.4','2.8','CNOT4-related factors','Family',3),('2.8.4.0.1','2.8.4','CNOT4 (NOT4) [1]','Genus',5),('2.9','2','C2CH THAP-type zinc finger factors','Class description: THAP-type zinc fingers follow the signature C- x(2-4)-C-x(35-50)-C-x2-H. Compared with \'canonical\' C2H2 zinc fingers, those of THAP type exhibit an unusually long spacing between the first pair of cysteines and the following cysteine-histidine pair, which together coordinate one zinc ion.