s a variant helix-turn-helix motif, the DNA-binding of which is accompanied by additional DNA-contacting loop structures and requires further contacts for sequence-specific binding. Among the seven mammalian subfamilies, only ARID3 and ARID5 were reported earlier to bind DNA in a sequence-specific manner (PMID 15922553 and references therein). Later on, a preferred binding sequence was also reported for JARID1A (PMID 18270511), and since there may be also subtle affinity differences for the other ARID factors, and all of them seem to have an impact on transcriptional control, all known factors have been listed here. They have been classified under superclass 3 since the recognition helix of the ARID domain inserts into the major groove in a similar manner as the \'classical\' helix-turn-helix motif.',2),('3.7.1','3.7','ARID-related factors','Family',3),('3.7.1.1','3.7.1','ARID1','Subfamily',4),('3.7.1.1.1','3.7.1.1','ARID1A (BAF250, BAF250A, OSA1, SMARCF1)','Genus',5),('3.7.1.1.2','3.7.1.1','ARID1B (BAF250, BAF250A, OSA1, SMARCF1)','Genus',5),('3.7.1.2','3.7.1','ARID2','Subfamily',4),('3.7.1.2.1','3.7.1.2','ARID2 (BAF200)','Genus',5),('3.7.1.3','3.7.1','ARID3','Subfamily',4),('3.7.1.3.1','3.7.1.3','ARID3A (Bright, DRIL1, DRIL3, DRX, E2FBP1)','Genus',5),('3.7.1.3.2','3.7.1.3','ARID3B (BDP, DRIL2)','Genus',5),('3.7.1.3.3','3.7.1.3','ARID3C','Genus',5),('3.7.1.4','3.7.1','ARID4','Subfamily',4),('3.7.1.4.1','3.7.1.4','ARID4A (RBBP1, RBP1)','Genus',5),('3.7.1.4.2','3.7.1.4','ARID4B (BRCAA1, RBBP1L1, RBP1L1, SAP180)','Genus',5),('3.7.1.5','3.7.1','ARID5','Subfamily',4),('3.7.1.5.1','3.7.1.5','ARID5A (MRF1)','Genus',5),('3.7.1.5.2','3.7.1.5','ARID5B (DESRT, MRF2)','Genus',5),('3.7.1.6','3.7.1','JARID1','Subfamily',4),('3.7.1.6.1','3.7.1.6','JARID1A (KDM5A, RBBP2, RBP2)','Genus',5),('3.7.1.6.2','3.7.1.6','JARID1B (KDM5B, PLU1, RBBP2H1)','Genus',5),('3.7.1.6.3','3.7.1.6','JARID1C (KDM5C, DXS1272E, SMCX, XE169)','Genus',5),('3.7.1.6.4','3.7.1.6','JARID1D (KDM5D, HY, HYA, SMCY