nus',5),('4.1.5.0.2','4.1.5','SSRP1 [1]','Genus',5),('4.1.6','4.1','UBF-related factors','Family',3),('4.1.6.1','4.1.6','UBF-related factors','Subfamily',4),('4.1.6.1.1','4.1.6.1','UBF [6]','Genus',5),('4.1.6.2','4.1.6','UBF-like proteins','Subfamily',4),('4.1.6.2.1','4.1.6.2','UBTFL1 [2]','Genus',5),('4.1.6.2.2','4.1.6.2','UBTFL6 [2]','Genus',5),('4.1.7','4.1','TFAM','Family',3),('4.1.7.0.1','4.1.7','TFAM (mtTFA, MtTF1, TCF6, TCF6L2) [2]','Genus',5),('4.2','4','Heteromeric CCAAT-binding factors','Class description: The heteromeric CCAAT-binding factor known from mammalian systems is NF-Y (CBF, CP1), a homolog of yeast HAP2/3/4. Like the latter, it is a heterotrimeric complex of which all three subunits NF-YA, NF-YB and NF-YC are required for binding to the CCAAT-element on the DNA. NF-YB and NF-YC both exhibit a histone-fold domain, showing some homology with histones H2B and H2A, respectively. These regions are required for heterodimerization, which is followed by docking of NF-YA. Modeling of the NF-Y complex and its binding to DNA according to the homology with histone and NC2 complexes suggests that the heterotrimeric complex provides an alpha-helically folded interface to interact with the DNA. Contribution of some loop structures is also conceivable. Upon binding through major and minor groove contacts, the NF-Y complex induces considerable bending of the DNA. (PMID 12401788)',2),('4.2.1','4.2','Heteromeric CCAAT-binding factors','Family',3),('4.2.1.0.1','4.2.1','NF-YA (CP1A, CBF-B)','Genus',5),('4.2.1.0.2','4.2.1','NF-YB (CP1B, CBF-A)','Genus',5),('4.2.1.0.3','4.2.1','NF-YC','Genus',5),('5','','&#945;-Helices exposed by &#946;-structures','Class description: Members of this superclass possess a DNA-contact interface of alpha-helices, which are exposed by a scaffold of beta-strands. Different to members of superclasses 1-4, the DNA-binding alpha helices do not insert in either groove but rather are packed against the DNA.',1),('5.1','5','MADS box factors','TRANSFAC&#174; class description C0014: Proteins of this class comprise a region of homology. The DNA-binding domain also comprises the dimerization capability. In the DNA-bound dimer (shown for SRF), two antiparallel amphipathic alpha-helices (alpha-I), form a coiled coil and are oriented approximately parallel on the minor groove. These helices make minor and major groove contacts, the N-terminal extensions form minor groove contacts. The bound DNA  is bent and wrapped around the protein. It exhibits a compressed minor groove in the center and widened minor groove in the flanks. (PMID 7637780)',2),('5.1.1','5.1','Regulators of differentiation','Family',3),('5.1.1.1','5.1.1','MEF-2','Subfamily',4),('5.1.1.1.1','5.1.1.1','MEF-2A','Genus',5),('5.1.1.1.2','5.1.1.1','MEF-2B (RSRFR2, xMEF2)','Genus',5),('5.1.1.1.3','5.1.1.1','MEF-2C','Genus',5),('5.1.1.1.4','5.1.1.1','MEF-2D','Genus',5),('5.1.2','5.1','Responders to external signals (SRF/RLM1)','Family',3),('5.1.2.0.1','5.1.2','SRF','Genus',5),('5.2','5','E2-related factors','Class',2),('5.2.1','5.2','E2','Family',3),('5.3','5','SAND domain factors','Class description: A twisted beta-sheet exposes four alpha-helices that are packed against one side of the sheet. Most important for DNA-binding is a KDWK motif at the N-terminus of the third alpha-helix. Residues of this alpha-helix and the KWDK motif contact bases through the major groove, but the alpha-helix does not insert into the major groove. The domain structure of some of the class members is supported by an overlaying zinc coordinating motif. (PMID 11427895, PMID 15649886)',2),('5.3.1','5.3','AIRE','Family',3),('5.3.1.0.1','5.3.1','AIRE','Genus',5),('5.3.2','5.3','DEAF','Family',3),('5.3.2.0.1','5.3.2','DEAF1','Genus',5),('5.3.3','5.3','GMEB','Family',3),('5.3.3.1','5.3.3','GMEB','Subfamily',4),('5.3.3.1.1','5.3.3.1','GMEB-1','Genus',5),('5.3.3.1.2','5.3.3.1','GMEB-2','Genus',5),('5.3.4','5.3','Sp110','Family',3),('5.3.4.0.1','5.3.4','Sp110','Genus',5),('5.3.5','5.3','Sp140/Sp100','Family',3),('5.3.5.1','5.3.5','Sp140-like factors','Subfamily',4),('5.3.5.1.1','5.3.5.1','Sp140','Genus',5),('5.3.5.1.2','5.3.5.1','Sp140L','Genus',5),('5.3.5.2','5.3.5','Sp100','Subfamily',4),('5.3.5.2.1','5.3.5.2','Sp100','Genus',5),('6','','Immunoglobulin fold','Class description: DNA-binding domains of this superclass exhibit an immunoglobulin-like fold. It is characterized by a beta-core structure, usually a beta-sandwich, which exposes a DNA-contact interface of mostly loops, but also other secondary structure elements, from which the DNA-binding amino acid residues are protruding.',1),('6.1','6','Rel homology region (RHR) factors','TRANSFAC&#174; class description C0020: The structure of the Rel-type DBD exhibits a bipartite subdomain structure, each subdomain comprising a beta-barrel with five loops that form an extensive contact surface to the major groove of the DNA. Particularly, the first loop of the N-terminal subdomain (the highly conserved recognition loop) performs contacts with the recognition element on the DNA, but other loops are involved. The fact that the main DNA-contacts are made through loops has been suggested to provide a high degree of flexibility in binding to a range of different target sequences. Augmenting interactions are achieved by two alpha-helices within the N-terminal part that form strong minor groove contacts to the A/T-rich center of the  B-element. In p65, the sequence between both alpha-helices is much shorter and even helix 2 is truncated. The second, C-terminal domain is necessary mainly for protein dimerization.',2),('6.1.1','6.1','NF-kappaB-related factors','Family',3),('6.1.1.1','6.1.1','NF-kappaB p50 subunit-like factors','Subfamily',4),('6.1.1.1.1','6.1.1.1','NF-&#954;B p105 (NFKB1)','Genus',5),('6.1.1.1.2','6.1.1.1','NF-&#954;B p100 (NFKB2)','Genus',5),('6.1.1.2','6.1.1','NF-kappaB p65 subunit-like factors','Subfamily',4),('6.1.1.2.1','6.1.1.2','NF-&#954;B p65 (RelA)','Genus',5),('6.1.1.2.2','6.1.1.2','RelB (I-Rel)','Genus',5),('6.1.1.2.3','6.1.1.2','c-Rel','Genus',5),('6.1.2','6.1','Ankyrin domain-only factors','Family',3),('6.1.2.1','6.1.2','I&#954;B-related factors','Subfamily',4),('6.1.2.1.1','6.1.2.1','I&#954;B&#945;','Genus',5),('6.1.2.1.2','6.1.2.1','I&#954;B&#946;','Genus',5),('6.1.2.1.3','6.1.2.1','I&#954;B&#948;','Genus',5),('6.1.2.1.4','6.1.2.1','I&#954;B&#949;','Genus',5),('6.1.2.1.5','6.1.2.1','I&#954;B&#950; (MAIL)','Genus',5),('6.1.2.1.6','6.1.2.1','I&#954;BR','Genus',5),('6.1.2.1.7','6.1.2.1','I&#954;BL','Genus',5),('6.1.2.1.8','6.1.2.1','BCL-3','Genus',5),('6.1.2.2','6.1.2','RelA-associated inhibitor','Subfamily',4),('6.1.2.2.1','6.1.2.2','RAI (iASPP)','Genus',5),('6.1.3','6.1','NFAT-related factors','Family',3),('6.1.3.0.1','6.1.3','NFATc1','Genus',5),('6.1.3.0.2','6.1.3','NFATc2 (NFATp)','Genus',5),('6.1.3.0.3','6.1.3','NFATc3 (NFATx)','Genus',5),('6.1.3.0.4','6.1.3','NFATc4 (NFAT3)','Genus',5),('6.1.3.0.5','6.1.3','NFAT5','Genus',5),('6.1.4','6.1','CSL-related factors','Family',3),('6.1.4.1','6.1.4','M','Subfamily',4),('6.1.4.1.1','6.1.4.1','RBP-J&#954;','Genus',5),('6.1.4.1.2','6.1.4.1','RBP-JL','Genus',5),('6.1.5','6.1','Early B-Cell Factor-related factors','Family',3),('6.1.5.0.1','6.1.5','EBF1 (COE1)','Genus',5),('6.1.5.0.2','6.1.5','EBF2 (COE2)','Genus',5),('6.1.5.0.3','6.1.5','EBF3 (COE3)','Genus',5),('6.1.5.0.4','6.1.5','EBF4 (COE4)','Genus',5),('6.2','6','STAT domain factors','Class description: STAT proteins bind to DNA as dimers. The DNA-contacting interface is organized by an eight-stranded beta-barrel, N-terminally preceded by a four-helix bundle and C-terminally followed by a mostly alpha-helical connector region. The residues that bind to the major groove of the DNA are mostly exposed by loops connecting the beta-strands of the beta-barrel and the one linking the beta-barrel and the first helix of the \'connector\' region. The STAT dimer nearly completely embraces the DNA double helix, compared with a \'pair of pliers\' (PMID 9671298), with the DNA-binding interface as jaws and the four-helix bundles as handles. Bound by STAT, the DNA undergoes a moderate bending of about 40 degrees. (PMID 9671298)',2),('6.2.1','6.2','STAT factors','Family',3),('6.2.1.0.1','6.2.1','STAT1','Genus',5),('6.2.1.0.2','6.2.1','STAT2','Genus',5),('6.2.1.0.3','6.2.1','STAT3','Genus',5),('6.2.1.0.4','6.2.1','STAT4','Genus',5),('6.2.1.0.5','6.2.1','STAT5A','Genus',5),('6.2.1.0.6','6.2.1','STAT5B','Genus',5),('6.2.1.0.7','6.2.1','STAT6','Genus',5),('6.3','6','p53 domain factors','Class description: A beta sandwich constitutes a scaffold that exposes several loops and a loop-sheet-helix motif. One of the loops forms a contact of an arginine residue in the minor, side chains of the loop-sheet-helix motif in the major groove of the DNA. (PMID 8023157, PMID 21464285)',2),('6.3.1','6.3','p53-related factors','Family',3),('6.3.1.0.1','6.3.1','p53','Genus',5),('6.3.1.0.2','6.3.1','p63','Genus',5),('6.3.1.0.3','6.3.1','p73','Genus',5),('6.4','6','Runt domain factors','TRANSFAC&#174; class description C0029: The members of this transcription factor class have been identified on the basis of their homology to a defined region within the Drosophila protein Runt. The runt domain (of RUNX1) contains twelve beta strands, seven of which shape the fold of an immunoglobulin-like beta sandwich (S-type Ig fold) also found in the DNA-binding domains of other transcription factors (NF-kappaB, NFAT, p53, STAT, and the T-domain) that is preceded by an N-terminal alpha helix (PMID 10404214, PMID 10545320, PMID 12217689). The runt domain is responsible for both DNA-binding and heterodimerization which occur at distinct, non-overlapping sites within the domain (PMID 11327761). Heterodimerization with CBFbeta leads to conformational changes in the runt domain (S-switch) that stabilize DNA binding. (PMID 10734228, PMID 11257229, PMID 12217689)',2),('6.4.1','6.4','Runt-related factors','Family',3),('6.4.1.0.1','6.4.1','Runx2 (PEBP2&#945;A, CBF-&#945;1)','Genus',5),('6.4.1.0.2','6.4.1','Runx1 (PEBP2&#945;B, CBF-&#945;2, AML-1)','Genus',5),('6.4.1.0.3','6.4.1','Runx3 (PEBP2&#945;C, CBF-&#945;3, AML-2)','Genus',5),('6.5','6','T-Box factors','TRANSFAC&#174; class description C0044: The T domain has originally been discovered in Brachyury (T) the founder member of the T-box family. It encodes a DNA binding domain of about 180 amino acids. X-ray analysis of the T domain showed that it binds as a dimer to a 20 nucleotide partially palindromic sequence. A new type of specific DNA contact is seen, in which a carboxy-terminal helix is deeply embedded into an enlarged minor groove without bending the DNA.',2),('6.5.1','6.5','Brachyury-related factors','Family',3),('6.5.1.0.1','6.5.1','T (Brachyury)','Genus',5),('6.5.1.0.2','6.5.1','TBX19','Genus',5),('6.5.2','6.5','TBrain-related factors','Family',3),('6.5.2.0.1','6.5.2','TBR-1','Genus',5),('6.5.2.0.2','6.5.2','TBR-2 (EOMES)','Genus',5),('6.5.2.0.3','6.5.2','TBX21 (T-bet)','Genus',5),('6.5.3','6.5','TBX1-related factors','Family',3),('6.5.3.0.1','6.5.3','TBX1','Genus',5),('6.5.3.0.2','6.5.3','TBX10 (TBX7)','Genus',5),('6.5.3.0.3','6.5.3','TBX15 (TBX14)','Genus',5),('6.5.3.0.4','6.5.3','TBX18','Genus',5),('6.5.3.0.5','6.5.3','TBX20','Genus',5),('6.5.3.0.6','6.5.3','TBX22','Genus',5),('6.5.4','6.5','TBX2-related factors','Family',3),('6.5.4.0.1','6.5.4','TBX2','Genus',5),('6.5.4.0.2','6.5.4','TBX3','Genus',5),('6.5.4.0.3','6.5.4','TBX4','Genus',5),('6.5.4.0.4','6.5.4','TBX5','Genus',5),('6.5.5','6.5','TBX6-related factors','Family',3),('6.5.5.0.1','6.5.5','TBX6','Genus',5),('6.5.5.0.2','6.5.5','MGA (MAD5) = 1.2.6.7.4','Genus',5),('6.6','6','NDT80 domain factors','Class description: A beta sandwich comprising a three-standed sheet packed against a four-stranded sheet constitutes a scaffold that exposes the DNA-contacting amino acid residues of six distinct regions. Most of these residues are located in loops, some are part of short alpha-helices or beta-strands. They form both minor and major groove contacts to the DNA. (PMID 12411490)',2),('6.6.1','6.6','Myelin gene regulatory factor-related factors','Family',3),('6.6.1.0.1','6.6.1','Myelin gene regulatory factor (MRF, C11orf9)','Genus',5),('6.7','6','Grainyhead domain factors','TRANSFAC class description C0051: Ancient family of factors characterized by a distinct type of DNA binding domain. Members of this class are known in C. elegans, Drosophila, and vertebrates, and involved in the regulation of diverse biological processes (PMID 12888489 and references therein). Majority of the factors are activators, but LBP-9 and CRTR-1 are repressors (PMID 10644752, PMID 11073954). On the basis of sequence similarity, class can be subdivided into the two families: LSF/CP2 and Grainyhead itself (PMID 12888489). Members of this class are characterized by the conserved DNA binding- and oligomerization-associated regions (PMID 12888489). Consensus DNA recognition element of the LSF/CP2 family members represents a direct bipartite repeat CNRG-N(6)-CNRG (PMID 9668115). LSF/CP2 factors bind DNA as homotetramers, Drosophila Elf-1 binds as a dimer (PMID 8349681).',2),('6.7.1','6.7','Grainyhead-related factors','Family',3),('6.7.1.1','6.7.1','GRH-like proteins','Subfamily',4),('6.7.1.1.1','6.7.1.1','GRH-L1 (CP2-L2, LBP-32, MGR)','Genus',5),('6.7.1.1.2','6.7.1.1','GRH-L2 (CP2-L3)','Genus',5),('6.7.1.1.3','6.7.1.1','GRH-L3 (CP2-L4)','Genus',5),('6.7.2','6.7','CP2-related factors','Family',3),('6.7.2.0.1','6.7.2','CP2 (LSF, SEF)','Genus',5),('6.7.2.0.2','6.7.2','CP2-L1 (LBP-9, CRTR-1)','Genus',5),('6.7.2.0.3','6.7.2','UBP-1 (LBP-1, SEF)','Genus',5),('7','','&#946;-Hairpin exposed by an &#945;/&#946;-scaffold','Class description: The DNA-binding domains of this superclass have an alpha/beta-structured scaffold that exposes a beta-hairpin. This hairpin is the main DNA-contacting element and inserts into the major groove of the DNA. (PMID 12682016, PMID 20147459)',1),('7.1','7','SMAD/NF-1 DNA-binding domain factors','TRANSFAC&#174; class description C0059: Significant similarities between DNA binding domains of Smad and NF1 factors have been revealed by a PSI-BLAST database search. Authors have proposed that Smad and NF1 factors belong to the same group of genes probably resulting from the common ancestry [25470]. For more details about Smad or NF1 factors see  and  correspondingly. TRANSFAC class description C0041: Proteins with 2 MAD-homology domains at N- and C-terminal ends, which have been named MH1 and MH2, are independently folded structures (PMID 10605817); the structure of the MH2 domain is a beta-sandwich with a 3-alpha-helix bundle at one end, and 3 large loops and an alpha-helix at the other end (PMID 10605817); the loop-helix region of one subunit packs against the 3-alpha-helix bundle of another subunit (PMID 10605817); MH1, a novel type of DBD, consists of 4 alpha-helixes, 6 short beta-strands, and 5 loops. Beta-strands form 2 small beta-sheets and 1 beta-hairpin (PMID 9741623); base-specific DNA recognition of the MH1 domain bound to a GTCT motif is via an 11-amino acid beta-hairpin, which lies in the major groove of the DNA (PMID 9741623, PMID 10605817); 3 classes of SMAD: Inhibitory SMADs (SMAD-6,SMAD-7), Receptor-regulated SMADs (SMAD-1, SMAD-2, SMAD-3, SMAD-5, SMAD-8), Common Mediator SMADs (SMAD-4, SMAD-4beta, SMAD-10). (PMID 10605817)',2),('7.1.1','7.1','SMAD factors','Family',3),('7.1.1.1','7.1.1','Regulatory Smads (R-Smad)','Subfamily',4),('7.1.1.1.1','7.1.1.1','SMAD1','Genus',5),('7.1.1.1.2','7.1.1.1','SMAD2','Genus',5),('7.1.1.1.3','7.1.1.1','SMAD3','Genus',5),('7.1.1.1.4','7.1.1.1','SMAD5','Genus',5),('7.1.1.1.5','7.1.1.1','SMAD9 (SMAD8)','Genus',5),('7.1.1.2','7.1.1','Co-activating Smads (Co-Smad)','Subfamily',4),('7.1.1.2.1','7.1.1.2','SMAD4','Genus',5),('7.1.1.3','7.1.1','Repressor-Smads (I-Smad)','Subfamily',4),('7.1.1.3.1','7.1.1.3','SMAD6','Genus',5),('7.1.1.3.2','7.1.1.3','SMAD7','Genus',5),('7.1.2','7.1','Nuclear factor 1','Family',3),('7.1.2.0.1','7.1.2','NF-1A','Genus',5),('7.1.2.0.2','7.1.2','NF-1B','Genus',5),('7.1.2.0.3','7.1.2','NF-1C','Genus',5),('7.1.2.0.4','7.1.2','NF-1X','Genus',5),('7.2','7','GCM domain factors','TRANSFAC class description C0031: Within the N-terminal parts of Drosophila GCM, human and mouse GCMa and murine GCMb, a region of about 150 AA was disclosed that exhibits a high degree of homology. This gcm-motif is responsible for DNA-binding. Within this motif, three regions of identity were discovered: A, 10 AA; B, 9 AA; C, 10 AA. Additionally, there are 7 conserved Cys and 4 conserved His residues scattered over the gcm-motif.',2),('7.2.1','7.2','GCM factors','Family',3),('7.2.1.0.1','7.2.1','GCMa (GCM1)','Genus',5),('7.2.1.0.2','7.2.1','GCMb (GCM2)','Genus',5),('8','','&#946;-Sheet binding to DNA','Class description: The DNA-binding domains of this superclass bind to DNA through single extended strands or beta-sheets. ',1),('8.1','8','TATA-binding proteins','Class description: A 10-stranded, anti-parallel beta-sheet forms a quasi-symmetric saddle-like structure, where the convex side is backed by four alpha-helices and the concave side exerts mostly hydrophobic interactions with the minor groove of the TATA-box. Binding of TBP imposes a significant kink of the DNA double helix axis. (PMID 10617571, and references cited therein)',2),('8.1.1','8.1','TBP-related factors','Family',3),('8.1.1.0.1','8.1.1','TBP','Genus',5),('8.1.1.0.2','8.1.1','TBP-L1 (TRF2)','Genus',5),('8.1.1.0.3','8.1.1','TBP-L2 (TRF3)','Genus',5),('8.2','8','A.T hook factors','Class description: The A.T hook is a short sequence motif of 9-16 amino acids, occurring in multiple repeats (3 in the human HMGA factors). It is unordered when free in solution, but adopts an extended conformation upon binding to the minor groove of an AT-rich DNA sequence. In contrast to TBP, it does not hydrophobically intercalate and therefore preserves the B conformation of the bound DNA. (PMID 9253416)',2),('8.2.1','8.2','HMGA factors','Family',3),('8.2.1.0.1','8.2.1','HMGA1 (HMGI(Y))','Genus',5),('8.2.1.0.2','8.2.1','HMGA2 (HMGI-C)','Genus',5),('9','','&#946;-Barrel DNA-binding domains','Class description: DNA-binding domains that have a beta-barrel fold and are not covered by superclasses 7-8 are compiled in this superclass.',1),('9.1','9','Cold-shock domain factors','TRANSFAC&#174; class description C0019: Cold-shock domain proteins are characterized by a highly conserved region first found in prokaryotic cold-shock proteins (PMID 1622927, PMID 8031301). This domain is a single-stranded nucleic acid-binding structure interacting with DNA or RNA. It consists of an antiparallel five-stranded beta-barrel, the strands of which are connected by turns and loops (PMID 8321288, PMID 8321289). Within this structure, a three-stranded beta-strand contains a conserved RNA-binding motif, RNP1 (PMID 8321288, PMID 8321289, PMID 8967899). Not all CSD proteins are transcription factors. Those which specifically bind to a certain sequence are termed Y-box proteins. - Proteins of this class were previously called protamine-like domain proteins because of having a highly positively charged domain with interspersed proline residues.',2),('9.1.1','9.1','Dbp factors','Family',3),('9.1.1.1','9.1.1','A (DbpA-like)','Subfamily',4),('9.1.1.1.1','9.1.1.1','DbpA','Genus',5),('9.1.1.2','9.1.1','B (DbpB/YB-1-like)','Subfamily',4),('9.1.1.2.1','9.1.1.2','YB-1 (DbpB)','Genus',5),('9.1.1.3','9.1.1','C (FRG Y2-like)','Subfamily',4),('9.1.1.3.1','9.1.1.3','YBX2 (DbpC, MSY2, FRG Y2)','Genus',5),('0','','Yet undefined DNA-binding domains','Class description: Factors of this superclass have been shown to bind to DNA in a sequence-specific manner, but their DNA-binding domain has not yet been identified and/or structurally characterized.',1),('0.1','0','AXUD/CSRNP domain factors','Class description: Factors of this family possess a conserved domain comprising a serine-rich, a basic and a cysteine-rich region. The mouse ortholog of CSRNAP-1 binds to AGAGTG. (PMID 17726538)',2),('0.1.1','0.1','CSRNP factors','Family',3),('0.1.1.0.1','0.1.1','CSRNP-1 (AXUD1, TAIP3)','Genus',5),('0.1.1.0.2','0.1.1','CSRNP-2 (TAIP12)','Genus',5),('0.1.1.0.3','0.1.1','CSRNP-3 (TAIP2)','Genus',5),('0.2','0','NonO domain factors','Class description: A group of multifunctional factors, probably involved in transcriptional as well as in splicing regulation. Transcriptional regulation is most likely through direct DNA-binding. All factors of this class identified so far exhibit a highly charge region of 124 amino acid residues N-terminally of two RRMs (RNA-recognition motifs).',2),('0.2.1','0.2','NonO-related factors','Family',3),('0.2.1.0.1','0.2.1','NONO (NMT55, p54(nrb), NRB54)','Genus',5),('0.2.1.0.2','0.2.1','SFPQ (PSF)','Genus',5),('0.2.1.0.3','0.2.1','PSPC1 (PSP1, Paraspeckle component 1)','Genus',5),('0.3','0','Leucine-rich repeat flightless-interacting proteins','Class description: A 100-aa DNA-binding domain has been identified in LRRFIP1; it shows only limited homology with the corresponding region in LRRFIP2, for which DNA-binding has not yet been shown. In either case, this region contains many charged side chains.',2),('0.3.1','0.3','LRRFIP factors','Family',3),('0.3.1.0.1','0.3.1','LRRFIP1 (GCF2, TRIP)','Genus',5),('0.3.1.0.2','0.3.1','LRRFIP2','Genus',5),('0.4','0','NFX1-type putative zinc finger factors','Class description: A large class of proteins, with most known members from the plant kingdom. The DNA-binding domain comprises a cysteine-rich region with a repeated motif of the signature C-x(1-6)-H-x-C-x3-C-h-x(3-4)-C-x(1-10)-C (with the lower-case histidine occasionally replaced by another cysteine). Although this motif has been denominated \'NFX1-type zinc finger\', neither zinc ion binding nor its 3D structure have been unravelled so far. (PMID 7964459, PMID 20522174)',2),('0.4.1','0.4','NFX1','Family',3),('0.4.1.0.1','0.4.1','NFX1 (NFX2)','Genus',5),('0.4.1.0.2','0.4.1','NFXL1 (OZFP)','Genus',5),('0.4.1.0.3','0.4.1','ZNFX1','Genus',5),('0.0','0','Uncharacterized','Class description: No DNA-binding domain has been identified in these factors, although there is evidence that they may be (DNA-binding) transcription factors.',2),('0.0.1','0.0','Nuclear localized protein 1','Family',3),('0.0.1.0.1','0.0.1','NULP1 (TCF25)','Genus',5),('0.0.2','0.0','PHF5','Family',3),('0.0.2.0.1','0.0.2','PHF5A (Ini, SF3b14b)','Genus',5),('0.0.3','0.0','RFXANK','Family',3),('0.0.3.0.1','0.0.3','RFXANK (ANKRA1, RFXB, Tvl-1)','Genus',5),('0.0.4','0.0','RFXAP','Family',3),('0.0.4.0.1','0.0.4','RFXAP','Genus',5),('0.0.5','0.0','PUR','Family',3),('0.0.5.0.1','0.0.5','Pur-&#945; (PURA, PUR1)','Genus',5),('0.0.5.0.2','0.0.5','Pur-&#946; (PURB)','Genus',5),('0.0.5.0.3','0.0.5','Pur-&#947; (PURG)','Genus',5),('0.0.6','0.0','NRF','Family',3),('0.0.6.0.1','0.0.6','NRF-1 (&#945;-pal)','Genus',5);
